import { useState } from "react"

export const useExampleData  = () => {
    const [exampleData, setExampleData] = useState([{id: 0, state: "Ausgaben", date: {day: 1, month: 3, year: 20223}, amount: 12.56, bankBalance:85.36},
                                                    {id: 1, state: "Einkommen", date: {day: 1, month: 3, year: 2023}, amount: 20, bankBalance:85.36}])
    
    return exampleData, setExampleData
}

export function getExampleData(){
    const { exampleData1 } = useExampleData()
    return exampleData1
}

//export const exampleData = [{id: 0, state: "Ausgaben", date: {day: 1, month: 3, year: 20223}, amount: 12.56, bankBalance:85.36},
//                            {id: 1, state: "Einkommen", date: {day: 1, month: 3, year: 2023}, amount: 20, bankBalance:85.36}]

export var sortUpDown = [1, 1, 1]

export const setSortUpDown = (value) => {
    sortUpDown = value
}
